from datetime import datetime
#Functions

#Check if the two entites might share a common substring
def findCommonSubstring(sub, obj):
	shortString = ""
	longString = ""
	if len(sub)<len(obj):
		shortString = sub
		longString = obj
	else:
		shortString = obj
		longString = sub
	if shortString in longString:
		#Making the assumption of 3 since the shortest name possible in the dataset is Zia
		if len(shortString)>3:
			return True
		else:
			return False
	else:
		return False

#Format date which conforms with the timestamp in indirect_network.csv
def dateFormatter(year,month,day):
	if len(month) == 1:
		month = "0"+month
	if len(day) == 1:
		day = "0"+day

	date = year+"-"+month+"-"+day
	return date

def convertStringDateToDateTime(stringDate):
	return datetime.strptime(stringDate, "%Y-%m-%d").date()


